import React, { useEffect } from "react";
import FlatLayout from "../components/layout/FlatLayout";
import styled from 'styled-components';
import Link from 'next/link';

const IntroWrapper = styled.div`
background:blue;
.inner{
  width:100%;
  padding:30px 0;
  max-width:380px;
  margin: 0 auto;
}

.intro-left{
  background:#64BEFD;
}
.intro-right{
  background:#fff;
}
`;

const JoinBoxVirtical = styled.div`
    width:100%;
    margin-top: 50px;
    .btn {
      display:block;
      width:100%;
      line-height:45px;
      border-radius:20px;
    }
`;


const Intro = () => {
  return (
    <FlatLayout title="도라에몽"> 
      <IntroWrapper className="row">
        <div className="intro-left col-md-6">
          <div className="inner">
            <h2>지금 무슨일이 일어났는지 확인해보세요!</h2>

            <JoinBoxVirtical>
              <span>오늘부터 페이지에 가입하세요</span>
              <Link  href="/register"><a className="btn register">가입하기</a></Link>
              <Link  href="/login"><a className="btn login">로그인</a></Link> 
            </JoinBoxVirtical>

          </div>
        </div>
        <div className="intro-right col-md-6"> 
          <div className="inner">
            TEST
          </div> 
        </div>
      </IntroWrapper>
    </FlatLayout>
  )
}

export default Intro;
